## Answer (0)

You can use the `useEffect` hook to close the tooltip when the mouse leaves the component. Here is an example:

```
import React, { createContext, useContext, useEffect, useState } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [isOpen, setIsOpen] = useState(false);

  const closeTooltip = () => {
    setIsOpen(false);
  };

  return (
    <TooltipContext.Provider value={{ isOpen, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);

const Tooltip = ({ children, content }) => {
  const { isOpen, closeTooltip } = useTooltip();

  useEffect(() => {
    return () => {
      closeTooltip();
    };
  }, [closeTooltip]);

  return (
    <div
      onMouseEnter={() => {
        closeTooltip();
      }}
      onMouseLeave={() => {
        closeTooltip();
      }}
    >
      {children}
      {isOpen && <div>{content}</div>}
    </div>
  );
};

export default Tooltip;
```

